import React, { useRef } from "react";
import { Link } from "react-router-dom";
import Logo from "../assets/img/logo2.png";

import HouseList from "./HouseList";

const YourComponent = () => {
  const houseListRef = useRef(null);

  const scrollToHouseList = () => {
    houseListRef.current.scrollIntoView({ behavior: "smooth" });
  };
};

const Header = () => {
  return (
    <header className="py-3 mb-3 border-b">
      <div className="container mx-auto flex justify-between items-center">
        <Link to="/">
          <img src={Logo} alt="logo modulhome" />
        </Link>

        <div className="flex items-center gap-6">
          <Link to="#" className="hover:text-violet-600 transition" onClick={scrollToHouseList}>
            Modules
          </Link>
          <Link
            to="#"
            className="bg-violet-700 text-white hover:bg-violet-900 px-4 py-3 rounded-lg transition"
            onClick={scrollToHouseList}
          >
            Villas
          </Link>
        </div>
      </div>
    </header>
  );
};

export default Header;
